/*Table structure for table `tbl_payment_term` */

DROP TABLE IF EXISTS `tbl_payment_term`;

CREATE TABLE `tbl_payment_term` (
  `payment_term_code` varchar(20) NOT NULL,
  `description` varchar(20) DEFAULT NULL,
  `created_date` datetime DEFAULT NULL,
  `created_by` varchar(20) DEFAULT NULL,
  `modified_date` datetime DEFAULT NULL,
  `modified_by` varchar(20) DEFAULT NULL,
  `status` int(11) DEFAULT '1',
  PRIMARY KEY (`payment_term_code`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tbl_payment_term` */

/*Table structure for table `tbl_po_detail` */

DROP TABLE IF EXISTS `tbl_po_detail`;

CREATE TABLE `tbl_po_detail` (
  `po_refno` varchar(20) DEFAULT NULL,
  `type` varchar(20) DEFAULT NULL,
  `description` varchar(20) DEFAULT NULL,
  `amount` decimal(20,2) DEFAULT NULL,
  `qty` int(12) DEFAULT '1'
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `tbl_po_detail` */

/*Table structure for table `tbl_po_dtl` */

DROP TABLE IF EXISTS `tbl_po_dtl`;

CREATE TABLE `tbl_po_dtl` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `po_reference_no` varchar(20) DEFAULT NULL,
  `item_code` varchar(20) DEFAULT NULL,
  `price` decimal(10,2) DEFAULT NULL,
  `quantity` decimal(10,2) DEFAULT '1.00',
  `seqno` int(11) DEFAULT NULL,
  `rr_quantity` decimal(10,0) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tbl_po_dtl` */

/*Table structure for table `tbl_po_inventory` */

DROP TABLE IF EXISTS `tbl_po_inventory`;

CREATE TABLE `tbl_po_inventory` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `item_code` varchar(20) DEFAULT NULL,
  `beginning_balance` decimal(10,2) DEFAULT '0.00',
  `received` decimal(10,2) DEFAULT '0.00',
  `received_date` datetime DEFAULT NULL,
  `issued` decimal(10,2) DEFAULT '0.00',
  `issued_date` datetime DEFAULT NULL,
  `ending_balance` decimal(10,2) DEFAULT '0.00',
  `remarks` text,
  `reference_no` varchar(20) DEFAULT NULL,
  `item_type` varchar(20) DEFAULT NULL,
  `created_date` datetime DEFAULT NULL,
  `created_by` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tbl_po_inventory` */

/*Table structure for table `tbl_po_master` */

DROP TABLE IF EXISTS `tbl_po_master`;

CREATE TABLE `tbl_po_master` (
  `estimate_refno` varchar(20) DEFAULT '0',
  `wo_refno` varchar(20) DEFAULT '0',
  `po_refno` varchar(20) NOT NULL,
  `attachment` longtext,
  `transaction_date` datetime DEFAULT NULL,
  `payment_id` varchar(20) DEFAULT NULL,
  `subtotal_amount` decimal(20,2) DEFAULT NULL,
  `discount` decimal(20,2) DEFAULT NULL,
  `discounted_price` decimal(20,2) DEFAULT NULL,
  `vat` int(3) DEFAULT NULL,
  `total_amount` decimal(20,2) DEFAULT NULL,
  `remarks` longtext,
  `created_by` varchar(20) DEFAULT NULL,
  `trans_status` enum('0','1') DEFAULT '1',
  PRIMARY KEY (`po_refno`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `tbl_po_master` */

/*Table structure for table `tbl_po_mst` */

DROP TABLE IF EXISTS `tbl_po_mst`;

CREATE TABLE `tbl_po_mst` (
  `po_reference_no` varchar(20) NOT NULL,
  `po_date` datetime DEFAULT NULL,
  `rr_reference_no` varchar(20) DEFAULT NULL,
  `rr_date` datetime DEFAULT NULL,
  `rr_quantity` int(11) DEFAULT NULL,
  `rr_post_reference_no` varchar(20) DEFAULT NULL,
  `rr_post_date` datetime DEFAULT NULL,
  `cv_reference_no` varchar(20) DEFAULT NULL,
